import Header from "./Header";

export default function Landing() {
  return (
    <div className="background">
      <Header />
      <div className="container">
        <div className="center-div">
          <button>Food</button>
          <button>Drinks</button>
          <button>Account Details</button>
        </div>
      </div>
    </div>
  );
}
